import './../../constants/Dimensions';
import { SharedCard } from './SharedCard';
import { TremorHands } from './../Animation/TremorHands';

export const CardGetFamiliar = () => {
  const image = <TremorHands/>;
  const description = 'Importance of correct Tremor Tasks';
  const navLink = 'List';

  return (
    <>
      <SharedCard image={image}  description={description} navLink={navLink} nextButton={nextButton}/>
    </>
  );
};
